import React from "react";
import { connect } from "react-redux";

function Counter({ state }) {
  return (
    <div>
      <h1>0</h1>
      <button>+</button>
      <button>-</button>
    </div>
  );
}
const mapStateToProps = (state) => {
  return { state };
};
export default connect(mapStateToProps)(Counter);
